import "./App.css";
import { useEffect, useState } from "react";
import axios from "axios";
import CitiesSearch from './components/CitiesSearch'

function App() {
    const [datas, setDatas] = useState({});

    //creation dune DB et push les 100 a linterieuur
    useEffect(() => {
        axios({
            method: "get",
            url: "https://unpkg.com/codes-postaux@3.3.0/codes-postaux.json",
        }).then((response) => setDatas(response.data.slice(0,100)));
    }, []);

    return (
    <div>
      <CitiesSearch/>
    </div>
    )
}

export default App;
